import './Header.css';

function Header({ toggleSidebar, isOpen, menuButtonRef }) {
  return (
    <header className="header">
      <Link to="/" className="logo-link">
        <img 
          src="/golf-ball-logo.png" 
          alt="Dobson Ranch Golf" 
          className="logo"
        />
      </Link>
      <h1>Dobson Ranch Golf Course</h1>
      <button 
        ref={menuButtonRef}
        className={`menu-button ${isOpen ? 'active' : ''}`} 
        onClick={toggleSidebar}
      >
        <span className="menu-icon">â˜°</span>
      </button>
    </header>
  );
}

